  const check = myFunction();

  useEffect( () => {

    if(check){
      console.log("Online");
      syncronised();
    }else{
      console.log("Offline");
      syncronised();
    }


  },[]);



  return (

    <div className="App">

      <h1>CHALLENGE</h1>
      <ListaProductos/>
      <CrearProducto/>
    </div>
  );
}

